using System; 
using Agility.Server.Scripting.ScriptAssembly;
 using System.IO;
namespace MyNamespace
{

 public class Class1
 {
  public Class1() 
  {
  }

  [StartMethodAttribute()] 
  public void Method1(ScriptParameters sp) 
  {
string path1 =sp.InputVariables[&quot;EXCEL&quot;];
string path2=sp.InputVariables[&quot;EXCELNEW&quot;];
string path3 =sp.InputVariables[&quot;INPUT_DOCUMENT_FOLDER_F938266C4CC640FC8C289D1FE732CD3E&quot;];
String path4 = path2+path3+&quot;.xlsm&quot;;


File.Copy(path1, path4); 
sp.OutputVariables[&quot;EXCEL&quot;]=path4;



  }
 }
}

