using Agility.Sdk.Model.DataAccess;
using Agility.Server.Core.Model.Validations;
using System.Data;
using System.Data.SqlClient;

namespace MyNamespace
{

 public class Class1
 {
  public Class1() 
  {
  }

  [StartMethodAttribute()] 
  public void Method1(ScriptParameters sp) 
  {
	SqlConnection cnn;
            string connetionString = sp.InputVariables[&quot;DATABASE_VARIABLE&quot;];
            cnn = new SqlConnection(connetionString);
            cnn.Open();
SqlCommand sqlCommand;
  SqlDataAdapter sqlDataAdapter = new SqlDataAdapter();
String query = &quot;delete from Form1120;delete from Form1040C;delete from Form1065;delete from Form1065k1;delete from Form1120G;delete from Form1120S;delete from Form1120SK;delete from Form8825&quot;;
                        sqlCommand = new SqlCommand(query, cnn);
                        sqlDataAdapter.UpdateCommand = new SqlCommand(query, cnn);
                        sqlDataAdapter.UpdateCommand.ExecuteNonQuery();
                        sqlCommand.Dispose();

  }
 }
}

